import React from 'react';
import EducationSection from './components/EducationSection';
import ExperienceSection from './components/ExperienceSection';
import ProjectSection from './components/ProjectSection';
import SkillsSection from './components/SkillsSection';
import TestimonialsSection from './components/TestimonialsSection';

const UserPortfolioView = ({ portfolioData }) => {
  // Assuming portfolioData is an object containing all the necessary data
  const { education, experience, projects, skills, testimonials } = portfolioData;

  return (
    <div className="portfolio-view">
      <EducationSection education={education} />
      <ExperienceSection experience={experience} />
      <ProjectSection projects={projects} />
      <SkillsSection skills={skills} />
      <TestimonialsSection testimonials={testimonials} />
      {/* You can add more sections or components as needed */}
    </div>
  );
};

export default UserPortfolioView;
